import Link from 'next/link';
import { useHomeState } from './hooks';
import { useEffect } from 'react';

const Home = () => {
    const { title, getData } = useHomeState();

    useEffect(() => { getData(); }, []);
    
    return (
        <>
            <h1>{title}</h1>
            <Link href="/about"><a>About</a></Link>
        </>
    );
};

export default Home;
